import { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import "./Home.css";

const Home = ({ user }) => {
    const navigate = useNavigate();
    const [currentUser, setCurrentUser] = useState(user);

    useEffect(() => {
        if (!user) {
            const storedUser = JSON.parse(localStorage.getItem("user"));
            if (!storedUser) {
                navigate("/login");
            } else {
                setCurrentUser(storedUser);
            }
        }
    }, [user, navigate]);

    if (!currentUser) {
        return <p>Đang tải...</p>;
    }

    return (
        <div className="home-container">
            {/* Navbar */}
            <nav className="navbar">
                <h1>Trung Tâm Gia Sư</h1>
                <div className="navbar-buttons">
                    <span>Thông tin cá nhân</span>
                    <span>Đăng xuất</span>
                </div>
            </nav>

            <div className="main-content">
                {/* Sidebar */}
                <aside className="sidebar">
                    <ul>
                        {currentUser.role === "hv" && (
                            <>
                                <li>📖 Lịch học</li>
                                <li>📊 Điểm số</li>
                                <li>💰 Đóng học phí</li>
                                <li>🔄 Học bù</li>
                            </>
                        )}
                        {currentUser.role === "gv" && (
                            <>
                                <li>📚 Lịch giảng dạy</li>
                                <li>📝 Chấm điểm học sinh</li>
                                <li>⏳ Chấm công</li>
                            </>
                        )}
                        {currentUser.role === "cm" && (
                            <>
                                <li>📖 Quản lý nhóm học</li>
                                <li>📊 Báo cáo tài chính</li>
                                <li>🗓️ Thời khóa biểu</li>
                            </>
                        )}
                        {currentUser.role === "ad" && (
                            <>
                                <li>⚙️ Quản lý hệ thống</li>
                                <li>📊 Doanh thu & lương</li>
                            </>
                        )}
                    </ul>
                </aside>

                {/* Nội dung Dashboard */}
                <main className="dashboard">
                    <h2>Bảng điều khiển</h2>
                    <p>Chào mừng bạn đến với hệ thống quản lý trung tâm.</p>

                    {currentUser.role === "hv" && (
                        <section>
                            <h3>🎓 Học viên</h3>
                            <button>Lịch học</button>
                            <button>Xem điểm số</button>
                            <button>Đóng học phí</button>
                            <button>Đăng ký học bù</button>
                        </section>
                    )}

                    {currentUser.role === "gv" && (
                        <section>
                            <h3>📝 Giáo viên</h3>
                            <button>Xem lịch giảng dạy</button>
                            <button>Nhập điểm học sinh</button>
                            <button>Chấm công</button>
                        </section>
                    )}

                    {currentUser.role === "cm" && (
                        <section>
                            <h3>📋 Quản lý trung tâm</h3>
                            <button>Tạo nhóm học</button>
                            <button>Quản lý lịch dạy</button>
                            <button>Xem báo cáo tài chính</button>
                            <button>Quản lý điểm danh</button>
                        </section>
                    )}

                    {currentUser.role === "ad" && (
                        <section>
                            <h3>⚙️ Quản trị viên</h3>
                            <button>Quản lý hệ thống</button>
                            <button>Xem báo cáo doanh thu</button>
                            <button>Quản lý tài khoản</button>
                        </section>
                    )}
                </main>
            </div>
        </div>
    );
};

export default Home;
